import { FaFlag } from 'react-icons/fa'
import { FaStar } from 'react-icons/fa'
import { FaListUl } from 'react-icons/fa'

export default function AttractionIcons() {


    return (
        <div className='attraction-icons'>
            <FaFlag />
            <FaStar />
            <FaListUl />
        </div>
    )
}
